import React from "react";
import ReactDOM from "react-dom";
import {IoIosPerson} from "react-icons/io";

function RegistrationPage() {
    return (
        <div>
            <form>
                <center>
                    <div className="mb-3 mt-5">
                        <table>
                        <IoIosPerson></IoIosPerson><input type="name" className="form-control" id="floatingInput" placeholder="Name" />
                            <input type="surname" className="form-control" id="floatingInput" placeholder="Surname" />
                            <input type="password" className="form-control" id="floatingInput" placeholder="Password" />
                            <input type="confirmPassword" className="form-control" id="floatingInput" placeholder="Confirm Password" />
                        </table>
                    </div>
                </center>
            </form>
            
        </div>
    );
}

export default RegistrationPage;
